import React from 'react'
import Footer from '../component/Footer'
import Navbar from '../component/Navbar'
import Testimonial from '../component/Testimonial'
import {BrowserRouter as Router,Routes,Route} from "react-router-dom";

const Aim = () => {
  return(
    <div>
    <p style={{textAlign:"center"}}>Lorem ipsum, dolor sit amet consectetur adipisicing elit. 
      Sunt cum blanditiis pariatur fugiat mollitia! Odit minus in perferendis pariatur, quas necessitatibus excepturi,
       voluptas quo, officia tenetur mollitia ipsam esse minima?</p>
    </div>
  )
}

const testimonial = () => {
  return (
    <div>
      <Navbar/>  
     
      <Router>
        <Routes>
                 <Route path="/aim-section" exact element={<Aim />} />
            </Routes>
        </Router>


      {/* <Aim /> */}
      <Testimonial />
      <Footer />
    </div>
  )
}


export default testimonial
